  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Sherburne
  National Wildlife Refuge summarizes Refuge activities during the 1997 fiscal year.
  The report begins with an introduction to the Refuge and a summary of the yearu2019s
  highlights and climatic conditions. Information about monitoring and studies- including
  surveys and censuses- is provided next. Habitat restoration and management projects
  are also covered; activities include wetland restoration, upland restoration, water
  level management, timber management, prescribed burning, and vegetation control.
  Fish and wildlife management is discussed next with emphasis on animal control.
  Coordination activities, such as interagency coordination, tribal coordination,
  private land activities, and Friends organizations, are outlined. The resource protection
  section provides information about law enforcement, wildfire preparedness, cultural
  resource management, and land acquisition. Information about public education and
  recreation is given including visitor services and outreach. Finally, Refuge planning
  and administration- including general administration and safety- are discussed.
  \ Refuge brochures are newsletters are attached.\",\n\t\"license_title\": \"License
